pragma solidity >=0.7.0 <0.9.0;

contract lockerFactory {
    
    address public manager;
    uint public numberOfLockers;
    
    struct Lockers {
        address lockerAddress;
        address sender;
        address receiver;
        uint amount;
        uint id;
    }
    
    mapping (uint => Lockers) public lockersDetails;
    
    address payable lockerCreated;
    
    constructor () {
        manager = msg.sender;
    }
    
   function createNewLocker (address payable _receiver) public payable {
        lockerCreated = payable(address (new Locker(msg.sender, _receiver, msg.value, numberOfLockers)));
        lockersDetails[numberOfLockers] = Lockers (lockerCreated, msg.sender, _receiver, msg.value, numberOfLockers);       
        (bool sent, bytes memory data) = lockerCreated.call{value: msg.value}("");
        require(sent, "Failed to send Ether");
        emit NewLockerCreated (msg.sender, lockerCreated, msg.value, block.timestamp, numberOfLockers);
        numberOfLockers++;
    }
    
    event NewLockerCreated (address indexed creator, address indexed contractAddress, uint amount, uint timeCreated, uint id);
    
    
    
}

contract Locker {
    
    address public sender;
    address payable public receiver;
    uint public amount;
    uint public id;
    bool public isReceived;
    
    
    receive() external payable {}
    
    fallback() external payable {}

    function getBalance() public view returns (uint) {
        return address(this).balance;
    }
    
    
    constructor (address _sender, address payable _receiver, uint _amount, uint _id) payable {
        sender = _sender;
        receiver = _receiver;
        amount = _amount;
        id = _id;
        isReceived = false;
    }
    
    function confirmReceipt () public {
        assert (msg.sender == sender);
        isReceived = true;
        emit paymentReceived ("Payment received succesfully", block.timestamp);
    }
    
    function collectPayment () public payable {
        require (msg.sender == receiver);
        require (isReceived == true);
        (bool sent, bytes memory data) = msg.sender.call{value: amount}("");
        require(sent, "Failed to send Ether");
        emit paymentCollected (amount, block.timestamp);
       
    }
    
    event paymentReceived (string info, uint time);
    event paymentCollected (uint amount, uint time);
    
}
